Мобильное приложение «Tunduk» - быстрый доступ к государственным электронным услугам!

Мобильное приложение «Tunduk» один из составляющих экосистем государственного цифрового управления Кыргызской Республики, где основной платформой является Государственный портал электронных услуг portal.tunduk.kg.

Для того чтобы войти в мобильное приложение Вам необходимо иметь облачную электронную подпись, где данная подпись выдается в центрах обслуживания населения бесплатно, после входа Вы можете настроить двухфакторную аутентификацию, что позволит расширить вход в мобильную приложению «Tunduk».

При помощи мобильного приложение Вы можете:
- получить услуги в онлайн режиме;
- подать заявку на получение услуги;
- оплатить за государственные и муниципальные услуги;
- инициировать обращение государственным органам;
- получать Push уведомления.
